import React, { Component } from "react";

import "../../styles/normalize.scss";
import "../../styles/base.scss";

import Banner from "../../components/features/Header/Banner";
import SobreDescricao from "../Sobre/SobreDescricao";
import SobreDesafios from "../Sobre/SobreDesafios";
import SobreJogos from "../Sobre/SobreJogos";
import PageContainer from "../../components/features/PageContainer";
import logo from "../../assets/images/logo.png";

import imgBanner from "../../assets/images/home-1280.png";

class Home extends Component {
  render() {
    let contentBanner = "A Vitória só depende de Você!";
    return (
      <PageContainer public={true}>
        <Banner imagemBanner={imgBanner} imagem={logo} text={contentBanner} />
        <SobreDescricao />
        <SobreDesafios />
        <SobreJogos />
      </PageContainer>
    );
  }
}

export default Home;
